import React from 'react';
import  s from './OnOff.module.css'

type OnOffType = {
    work:boolean
}

export const OnOff = (props:OnOffType) => {
    return (
        <div>
            {!props.work&&<On/>}
            {props.work&&<Off/>}

        </div>
    );
};

export const On = ()=>{
    return (
        <div>
            <button className={s.colorButton}>on</button>
            <button>off</button>
            <button className={s.round }></button>
        </div>
        )

}

export const Off = ()=>{
    return (
        <div>
            <button >on</button>
            <button className={s.colorButton1}>off</button>
            <button className={s.round }></button>
        </div>
    )

}
